<template>
	<h1 @click="decode">Testing</h1>
	<ul>
		<li v-for="(v, k) in dataFields" :key="k">{{ k }}: {{ v }}</li>
	</ul>
</template>

<script>
import Knight from "./assets/data/dat_cla_0.json";
import Hunt from "./assets/data/dat_cla_1.json";
import Mage from "./assets/data/dat_cla_2.json";

export default {
	data() {
		return {
			dataFields: {},
			str:
				"#970ebca56c2175b84500fd5ed0c693a2cb27ed31#",
			str2:
				"#bd4e8219c530b981f05d3d761b975287d1d44b61#",
		};
	},
	mounted() {
		this.decode();
	},
	methods: {
		decode() {
			let r = this.str.substring(0, this.str.indexOf("#"));
			let i = 0;
			let asciish = "";
			while (i < r.length - 1) {
				let hex = r[i] + r[i + 1];
				asciish += String.fromCharCode(parseInt(hex, 16));
				i += 2;
			}
			const isNumber = (c) => {
				return (
					c.charCodeAt(0) >= "0".charCodeAt(0) &&
					c.charCodeAt(0) <= "9".charCodeAt(0)
				);
			};
			const getStartIndex = (idx) => {
				while (idx < asciish.length && !isNumber(asciish[idx])) ++idx;
				return idx;
			};
			const getEndIndex = (idx) => {
				while (
					idx < asciish.length &&
					(["/", ":", ",", "-", "|"].includes(asciish[idx]) ||
						isNumber(asciish[idx]))
				)
					++idx;
				return idx;
			};
			const getNextSection = (idx) => {
				let start = getStartIndex(idx);
				return asciish.substring(start, getEndIndex(start)).split("|");
			};

			this.dataFields.weapon_data = getNextSection(
				asciish.indexOf("weapon_data")
			);
			this.dataFields.weapon_equip = getNextSection(
				asciish.indexOf("weapon_equip")
			);
			this.dataFields.traits = asciish.match(
				/\d+,\d+,\d+,\d+,\d+,\d+,\d+,\d+\|\d+,\d+,\d+,\d+,\d+,\d+,\d+,\d+\|\d+,\d+,\d+,\d+,\d+,\d+,\d+,\d+/
			);
			this.dataFields.skill_equip = getNextSection(
				asciish.indexOf("skill_equip")
			);

			let skills = [Knight, Hunt, Mage];
			let result = [
				[[], [], [], [], []],
				[[], [], [], [], []],
				[[], [], [], [], []],
			];
			for (let i = 0; i < this.dataFields.skill_equip.length; ++i) {
				let dat = this.dataFields.skill_equip[i]
					.split(",")
					.map((n) => parseInt(n));
				console.log(dat);
				for (let ref = 0; ref < dat.length; ++ref) {
					if (dat[ref] !== -1)
						result[i][dat[ref]].push(
							skills[i].find((o) => o.REF === ref)[
								this.settings.language + "_NAME"
							]
						);
				}
			}
			this.dataFields.skill_equip_processed = result;
			console.table(result);

			// Number of use for the 3+8 base skills?
			// Then rank of each upgrade!
			this.dataFields.skill_rank = getNextSection(
				asciish.indexOf("skill_rank")
			);

			this.dataFields.asciish = asciish;

			return asciish;
		},
	},
};
</script>

